Defendant in custody.    
Defendant is before the Court for sentencing, her probation having been revoked effective 12-05-18.    
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of four (4) years.   Two (2) years initial confinement, followed by two (2) years extended supervision, concurrent with the sentence defendant is presently serving.   Court finds the defendant is eligible for the Substance Abuse Program but not for the Challenge Incarceration Program.   Conditions of extended supervision are:   
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) AODA assessment and follow through; 
3) Maintain absolute sobriety; 
4) Have no presence in any bars, taverns, liquor stores where the primary business is the sale of alcohol; 
5) Maintain full-time employment/schooling combination; 
6) Submit DNA sample and pay surcharge; 
7) Pay fine and costs owing; 
8) Pay supervision fees in an amount to be determined by DOC.   
Defendant is entitled to 348 days sentence credit.   
Minutes.

Count 1 - Operate under influence (6th) - Guilty plea.   Convicted.   State moves to dismiss and read in count 2, 3, 4, and 6.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for three (3) years.   Conditions of probation are:
1) Spend twelve (12) months in Manitowoc County Jail, under the Huber Law, to commence immediately;
2) Pay $1,500.00 fine, plus costs, total of $2,908.00;
3) AODA assessment and follow through;
4) Maintain absolute sobriety;
5) Maintain full-time work, job search, school or combination;
6) Submit DNA sample;
7) Pay supervision fees in an amount to be determined by DOC.
Court imposes a thirty-six (36) month license revocation and ignition interlock for a period of revocation.  
